import React, { useEffect, useState } from "react"
import styled from "styled-components"
import { Link } from "react-router-dom"
import FILE1 from "../components/files/file1"
import axios from "axios"

const Container = styled.div`
  display: flex;
`
const Wrapper = styled.div`
  background-color: #fff;
  width: 30%;
  height: 300px;
  margin: 0 20px;
  display: flex;
  flex-direction: column;
  align-items: center;
`
const Item = styled.div`
  margin-bottom: 15px;
`
const Title = styled.label`
  display: block;
`
const Input = styled.input`
  width: 300px;
  height: 30px;
`
const Table = styled.table`
  padding: 0;
  width: 60%;
`
const Tr = styled.tr`
  border: 1px solid #fff;
`
const Th = styled.th`
  border: 1px solid #fff;
`
const Td = styled.td`
  border: 1px solid #fff;
`
const Button = styled.button`
  width: 300px;
  height: 40px;
  cursor: pointer;
`
const Home = () => {
  const [data, setData] = useState([])
  const [postData, setPostData] = useState({})

  useEffect(() => {
    fetch("https://traveol.herokuapp.com/api/contact")
      .then((response) => response.json())
      .then((json) => setData(json))
      .catch((err) => console.log("Request Failed", err))
  }, [postData])

  const backgroundSync = () => {
    navigator.serviceWorker.ready.then((swRegistration) =>
      swRegistration.sync.register("post-data").catch((err) => console.log(err))
    )
  }
  const addData = (data) => {
    const dbname = "MyDB"
    const requestDB = window.indexedDB.open(dbname)

    requestDB.onupgradeneeded = () => {
      let db = requestDB.result
      let store = db.createObjectStore("book", { autoIncrement: true })
      //put method
      store.put(data)
    }

    requestDB.onsuccess = () => {
      if (requestDB.readyState === "done") {
        console.log("put data success")
      }
    }
  }

  const sendData = (data) => {
    fetch("https://traveol.herokuapp.com/api/contact", {
      method: "POST",
      body: JSON.stringify({ name: "dd", email: "dd", content: "dd" }),
      headers: { "Content-type": "application/json; charset=UTF-8" },
    })
      .then((response) => response.json())
      .then((json) => console.log(json))
      .catch((err) => {
        console.log(err)
        addData(data)
        backgroundSync()
      })
  }
  const handleAdd = () => {
    setData((prev) => [...prev, postData])
    sendData(postData)
  }
  const handleDelete = () => {}

  return (
    <Container>
      <Table border={1}>
        <Tr>
          <Th>ID</Th>
          <Th>name</Th>
          <Th>email</Th>
          <Th>content</Th>
          <Th>created at</Th>
        </Tr>
        {data.length >= 0 &&
          data.map((item) => (
            <Tr key={item._id}>
              <Td>
                <Link to={`audioID=${item._id}`}>{item._id}</Link>
              </Td>
              <Td>{item.name}</Td>
              <Td>{item.email}</Td>
              <Td>{item.content}</Td>
              <Td>{item.createdAt}</Td>
              <Td>
                <button onClick={handleDelete}>X</button>{" "}
              </Td>
            </Tr>
          ))}
      </Table>
      <Wrapper>
        <Item>
          <Title>Name</Title>
          <Input
            onChange={(e) =>
              setPostData({
                name: e.target.value,
                email: postData.email,
                content: postData.content,
              })
            }
            value={postData.name}
          />
        </Item>
        <Item>
          <Title>Email</Title>
          <Input
            onChange={(e) =>
              setPostData({
                name: postData.name,
                email: e.target.value,
                content: postData.content,
              })
            }
            value={postData.email}
          />
        </Item>
        <Item>
          <Title>Content</Title>
          <Input
            onChange={(e) =>
              setPostData({
                name: postData.name,
                email: postData.email,
                content: e.target.value,
              })
            }
            value={postData.content}
          />
        </Item>
        <Button onClick={handleAdd}>add</Button>
      </Wrapper>
      {/* <Table border={1}>
        <Tr>
          <Th>ID voice</Th>
          <Th>ID Agent</Th>
          <Th>Agent name</Th>
          <Th>ID Customer</Th>
          <Th>Customer name</Th>
          <Th>date</Th>
          <Th>call hold duration</Th>
          <Th>call duration</Th>
        </Tr>
        {data.length >= 0 &&
          data.map((item) => (
            <Tr key={item.audioID}>
              <Td>
                <Link to={`audioID=${item.audioID}`}>{item.audioID}</Link>
              </Td>
              <Td>{item.audioCredit.agent.agentID}</Td>
              <Td>{item.audioCredit.agent.name}</Td>
              <Td>{item.audioCredit.customer.customerID}</Td>
              <Td>{item.audioCredit.customer.name}</Td>
              <Td>{item.audioCredit.date}</Td>
              <Td>{item.audioCredit.callHoldDration}</Td>
              <Td>{item.audioCredit.callDuration}</Td>
              <Td>
                <button onClick={handleDelete}>X</button>{" "}
              </Td>
            </Tr>
          ))}
      </Table> */}
    </Container>
  )
}

export default Home
